import{_ as e}from"./chunks/overview.CVFRh3NM.js";import{_ as t,c as a,o,a4 as n}from"./chunks/framework.uQk9_EO2.js";const s="data:image/png;base64,",r="/docs/cocos/assets/lang-provider.Qdyim9tp.png",l="data:image/png;base64,",i="/docs/cocos/assets/complement.CYFroc4T.png",c="/docs/cocos/assets/new-key.BEeknN2U.png",p="/docs/cocos/assets/unfilled.YF6Ca6Z5.png",g="/docs/cocos/assets/other.KEFmAgSd.png",h="/docs/cocos/assets/translate.BwyCptq6.png",d="/docs/cocos/assets/translate-overview.RvKCI_Vm.png",u="/docs/cocos/assets/translate-complete.DF78kKsN.png",A="/docs/cocos/assets/translated-variant.CDlgFP4I.png",m="/docs/cocos/assets/preview-overview.BtSPaDEv.png",f="/docs/cocos/assets/original-preview.CnDBm67e.png",b="/docs/cocos/assets/translate-preview.B3WDNx9P.png",v="/docs/cocos/assets/export.kl2NpMPy.png",w="/docs/cocos/assets/delete.CVtqPFPw.png",y="/docs/cocos/assets/import-image.C_Nur1sT.png",q="/docs/cocos/assets/asset.CeP8XDLF.png",k="/docs/cocos/assets/import-other-lang-jpg.BRwRMOAZ.png",D="/docs/cocos/assets/source-matching.B0mPXjlL.png",P="/docs/cocos/assets/before-matching.CGznJ7NX.png",C="/docs/cocos/assets/matching-result.CZeoF8si.png",V="data:image/png;base64,",x="/docs/cocos/assets/import-csv.Czclf09g.png",S="/docs/cocos/assets/conflict.DdtBhy1z.png",M=JSON.parse('{"title":"Compile Language","description":"","frontmatter":{},"headers":[],"relativePath":"en/editor/l10n/compile-language.md","filePath":"en/editor/l10n/compile-language.md","lastUpdated":1712305443000}'),L={name:"en/editor/l10n/compile-language.md"},N=n('<h1 id="compile-language" tabindex="-1">Compile Language <a class="header-anchor" href="#compile-language" aria-label="Permalink to &quot;Compile Language&quot;">​</a></h1><p><img src="'+e+'" alt="overview"></p><p>Once the local development language is selected in the <a href="./collect-and-count">Collect and Count</a> view, the compilation process can be configured. This will include features such as <strong>automatic translation</strong>, <strong>manual translation</strong>, <strong>variants</strong>, etc.</p><h2 id="language" tabindex="-1">Language <a class="header-anchor" href="#language" aria-label="Permalink to &quot;Language&quot;">​</a></h2><p>Developers can choose to add a new language here.</p><p><img src="'+s+'" alt="add"></p><p>The language in the first row is <strong>Local Development Language</strong>, which records the local language used in the current development process, and can usually be chosen as a language familiar to the developer. Under this language, <strong>Operation</strong> column appears <strong>Complete</strong> function, which is used to record the original text of the Label component and should be used with <a href="./l10n-label">L10nLabel</a>. Please refer to the following for details.</p><p>Starting from the second line, the language used in the target country/region, developers need to select at least one language of the target country/region for the translation option to appear.</p><h2 id="languages-recognized-by-translation-service-providers" tabindex="-1">Languages recognized by translation service providers <a class="header-anchor" href="#languages-recognized-by-translation-service-providers" aria-label="Permalink to &quot;Languages recognized by translation service providers&quot;">​</a></h2><p><img src="'+r+'" alt="provider"></p><p>The above chart is used to select the input/output language type of the translation service provider at the time of automatic translation.</p><ul><li><p>For native development languages, the input language type is selected.</p></li><li><p>For the translation language, the selection is for the output language type.</p></li></ul><p>For example, in the above figure, the local development language is English (en), then the drop-down menu needs to select <strong>English</strong>.</p><p>And the translation language is <strong>Simplified Chinese (zh-Hans-CN)</strong>, then in the drop-down menu, please select <strong>zh-CHS</strong>.</p><blockquote><p><strong>Note</strong>: If the drop-down menu is not available, please check if <a href="./translation-service">AppKey/AppSecret</a> is configured correctly.</p></blockquote><h2 id="translation-progress" tabindex="-1">Translation Progress <a class="header-anchor" href="#translation-progress" aria-label="Permalink to &quot;Translation Progress&quot;">​</a></h2><p><img src="'+l+'" alt="progress"></p><p>Shows current translation progress.</p><h2 id="operations" tabindex="-1">Operations <a class="header-anchor" href="#operations" aria-label="Permalink to &quot;Operations&quot;">​</a></h2><p>The actions field provides <strong>Complement</strong> functionality for native development languages and <strong>Translation</strong> functionality for target translation languages. Common functions for both include <strong>Preview</strong>, <strong>Export</strong> and <strong>Delete</strong>.</p><h3 id="complement" tabindex="-1">Complement <a class="header-anchor" href="#complement" aria-label="Permalink to &quot;Complement&quot;">​</a></h3><p><strong>Complement</strong> for only taking effect when the current language is set to <strong>Local Development Language</strong>. The purpose of the complement feature is to record the original text of the content to be translated in the current development language. All the original text data obtained by the <strong>Collect and Count</strong> function will be displayed here. When you click on it, you can view all the results.</p><p><img src="'+i+'" alt="complemenet"></p><p>When adding a key via the <a href="./l10n-label">L10nLabel</a> component within a prefab or scene:</p><p><img src="'+c+'" alt="new key"></p><p>You can find the corresponding key in the <strong>Complement</strong> panel, enter the value of the key in the Original field, and click the <strong>Save</strong> button to save the original text, which will be automatically filled if the Label&#39;s String property has a value.</p><p><img src="'+p+'" alt="unfilled"></p><p>Non-text resources such as images and audio are also complemented, see the <strong>Non-Text Resources</strong> section below for details.</p><h3 id="variants" tabindex="-1">Variants <a class="header-anchor" href="#variants" aria-label="Permalink to &quot;Variants&quot;">​</a></h3><p>The variant function is specially used to solve the plural problem encountered in translation. The system will automatically adjust the translation content according to the rules of variants, and users can also freely set the rules of variants.</p><p>In the <strong>Complement</strong> panel, click the <strong>Variant</strong> button to enter a new variant.</p><p><img src="'+g+'" alt="otehr"></p><p>After the <strong>Complement</strong> is done, remember that you need to click the <strong>Save</strong> button above to save it.</p><p>The number of variants is language dependent and is one of the international rules, which interested users can check by moving to <a href="https://cldr.unicode.org/" target="_blank" rel="noreferrer">https://cldr.unicode.org/</a>.</p><p>For more information, see <a href="./l10n-label">L10nLabel Variant Count</a>.</p><h3 id="translation" tabindex="-1">Translation <a class="header-anchor" href="#translation" aria-label="Permalink to &quot;Translation&quot;">​</a></h3><p>Once the key value and the original text have been added to the <strong>Complement</strong> function, you can use the translation service provider&#39;s translation service to translate by clicking on the <strong>Translat</strong> button to bring up the translation interface.</p><p><img src="'+h+'" alt="translate"></p><p>Click on the <strong>Translate</strong> button at the top right to translate.</p><p><img src="'+d+'" alt="translate-overview"></p><p>Once the translation is complete, the results can be viewed in the <strong>Translation</strong> sub-page.</p><p><img src="'+u+'" alt="complete"></p><p>For translated text, different translations can also be added by clicking on <strong>Variant</strong>:.</p><p><img src="'+A+'" alt="variant"></p><blockquote><p><strong>Note</strong>: This feature only works if the <strong>Translation Service Provider</strong> is properly configured.</p></blockquote><h3 id="preview" tabindex="-1">Preview <a class="header-anchor" href="#preview" aria-label="Permalink to &quot;Preview&quot;">​</a></h3><p>Click Preview to get a quick preview of how the nodes/image resources etc. of the <a href="./l10n-label">L10nLabel</a> component are displayed in that language for the current scene:</p><p><img src="'+m+'" alt="preview"></p><p>Before translation:</p><p><img src="'+f+'" alt="pev"></p><p>After translation:</p><p><img src="'+b+'" alt="prev"></p><h3 id="export" tabindex="-1">Export <a class="header-anchor" href="#export" aria-label="Permalink to &quot;Export&quot;">​</a></h3><p>Click the <strong>Export</strong> button to export the original/translated content to a PO file.</p><blockquote><p>PO file is a common text-based object file in software development, usually used to record the result of interface translation.</p></blockquote><p><img src="'+v+'" alt="export"></p><p>The following are some supplementary translation tools, which developers can choose according to their needs.</p><ul><li>Manipulating PO Files</li><li><a href="https://poedit.net/" target="_blank" rel="noreferrer">https://poedit.net/</a></li><li><a href="https://github.com/translate/translate" target="_blank" rel="noreferrer">https://github.com/translate/translate</a></li><li><a href="https://omegat.org/" target="_blank" rel="noreferrer">OmegaT - The Free Translation Memory Tool - OmegaT 3</a></li></ul><h3 id="delete" tabindex="-1">Delete <a class="header-anchor" href="#delete" aria-label="Permalink to &quot;Delete&quot;">​</a></h3><p><img src="'+w+'" alt="del"></p><p>Delete the translated progress of the current language. The result will not be saved after confirmation, so please operate with caution. Local development languages cannot be deleted.</p><h2 id="non-text-resources" tabindex="-1">Non-text resources <a class="header-anchor" href="#non-text-resources" aria-label="Permalink to &quot;Non-text resources&quot;">​</a></h2><p>Localization may also be required when there is text drawn on images, video and audio dubbed in different languages in the project. In this case, the translation interface will provide the <strong>Import</strong> button, and here is an example of how to configure localization using images.</p><p><img src="'+y+'" alt="image"></p><p>When <strong>Collection and Count</strong> is complete, the detected resources will be in the form of paths as key values.</p><p><img src="'+q+'" alt="assets"></p><p>Import the images required for the target language by clicking on the <strong>Import</strong> button to.</p><p><img src="'+k+'" alt="dest image"></p><blockquote><p><strong>Note</strong>.</p><ol><li>When importing, you can only import the files in the project.</li><li>Since auto-atlas will modify the uuid of the resource, it will cause the redirection failure, so the images that need to be translated cannot be checked for auto-atlas function.</li></ol></blockquote><h3 id="intelligent-matching" tabindex="-1">Intelligent Matching <a class="header-anchor" href="#intelligent-matching" aria-label="Permalink to &quot;Intelligent Matching&quot;">​</a></h3><p>The Intelligent Matching button will bring up a secondary confirmation menu, clicking on it will enable intelligent matching. Intelligent matching will be modified by the file name and match the corresponding language. Example.</p><p>The source file is: assets/aassb/cn-abc001.jpg and needs to be translated into English, its translation file is: assets/aassb/en-abc001.jpg, we will automatically replace cn in assets/aassb/cn-abc001.jpg with en.</p><p>Operation steps.</p><ul><li><p>For example, when our local development language is Chinese (zh) and the language to be translated is English (en), the following resources may be prepared as shown in the figure below:</p><p><img src="'+D+'" alt="source"></p></li><li><p>After clicking <strong>Intelligent Matching</strong>, select Confirm in the secondary menu that pops up:</p><p><img src="'+P+'" alt="before"></p></li><li><p>Developers do not need to import them manually, and role.jpg in different languages will be automatically matched with:</p><p><img src="'+C+'" alt="result"></p></li></ul><h2 id="import-files" tabindex="-1">Import Files <a class="header-anchor" href="#import-files" aria-label="Permalink to &quot;Import Files&quot;">​</a></h2><p>The <strong>Import File</strong> button allows you to import external data files, supporting PO, CSV and XLSX formats.</p><p>The format requirements for CSV and XLSX are as follows.</p><p><img src="'+V+'" alt="xlsx"></p><p>The file should be in UTF-8 encoding format.</p><p><img src="'+x+'" alt="csv"></p><p>After importing, if you need to translate manually, the process is the same as the above document.</p><h3 id="conflict-resolution" tabindex="-1">Conflict resolution <a class="header-anchor" href="#conflict-resolution" aria-label="Permalink to &quot;Conflict resolution&quot;">​</a></h3><p>If you import the same external file repeatedly, a conflict will occur, and you will need to resolve the conflict manually at this point:</p><p><img src="'+S+'" alt="conflict"></p><ul><li><strong>Skip</strong>: skip the conflicting key value, no additional processing.</li><li><strong>Cover</strong>: Overwrite the existing key value, the old data will be discarded.</li></ul>',85),B=[N];function K(O,T,H,Z,R,j){return o(),a("div",null,B)}const Q=t(L,[["render",K]]);export{M as __pageData,Q as default};
